import logo from './logo.svg';
import './App.css';
import React, {useEffect, useState} from 'react'
import { Simulacoes } from './components/Simulacoes.js';


function App() {
  const [dados, setDados] = useState([]);

  useEffect(() =>{
    fetch("/teste").then(response => 
      response.json().then(data => {
        setDados(data.dados);
      })
    );
  }, []);

  console.log(dados);

  return (
    <div className="App">
      <Simulacoes dados={dados}/>
    </div>
  );
}

export default App;
